import React, { Component } from "react";
import { Navbar, Nav } from 'react-bootstrap';
import { BrowserRouter as Router, Route, Link, Redirect } from 'react-router-dom'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHome, faAddressBook, faHamburger, faUsers, faTags, faSignOu } from '@fortawesome/free-solid-svg-icons'
import '../App.css'

export default class Navbar1 extends Component {

  state={
    navigate: false
  };

  logout(){
    localStorage.clear("login");
    this.setState({
      navigate:true
    })
  }

  render() {

    const {navigate} = this.state

    if(navigate){
      return(
        <Redirect to="/"  push={true}/>
      )
    }

    return (
      <div>
        <Navbar  collapseOnSelect expand="lg" bg="dark" variant="dark">
            <div className="container">
          <Navbar.Brand><Link to="/" className="links"><img src={require('../media/logo.PNG')} height="40px" /> Tamra Restaurant </Link></Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
              
            </Nav>
            <Nav>
              <Nav.Link as='li'><Link to='/' className="links"><FontAwesomeIcon icon={faHome} />  Home</Link></Nav.Link>           
              <Nav.Link as='li'><Link to='/about' className="links"> <FontAwesomeIcon icon={faUsers} /> About Us</Link></Nav.Link>
              <Nav.Link as='li'><Link to='/service' className="links"><FontAwesomeIcon icon={faHamburger} /> Services</Link></Nav.Link>
              <Nav.Link as='li'><Link to='/pricing' className="links"><FontAwesomeIcon icon={faTags} /> Pricing</Link></Nav.Link>
              <Nav.Link as='li'><Link to='/contact' className="links"><FontAwesomeIcon icon={faAddressBook} /> Contact Us</Link></Nav.Link>              
              <p style={{color:"white", marginTop:"1.5%", cursor:"pointer"}} onClick={()=> this.logout}><FontAwesomeIcon icon={faAddressBook} /> Logout</p>   
            </Nav>
          </Navbar.Collapse>
          </div>
        </Navbar>
      </div>
    );
  }
}
